import React, { Component } from 'react';
import {
  ComposedChart,
  Line,
  Area,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from 'recharts';
import ChartWrapper from '../../Charts.styles';

export default class extends Component {
  render() {
    const { datas, width, height, colors } = this.props;
    return (
      <ChartWrapper className="isoChartWrapper">
        <ComposedChart
          width={width}
          height={height}
          data={datas}
          margin={{ top: 20, right: 20, bottom: 20, left: 20 }}
        >
          <XAxis dataKey="name" stroke={colors[3]} />
          <YAxis stroke={colors[3]} />
          <Tooltip />
          <Legend />
          <CartesianGrid stroke="#f5f5f5" />
          <Area
            type="monotone"
            dataKey="amt"
            fill={colors[0]}
            stroke={colors[0]}
          />
          <Bar dataKey="pv" barSize={20} fill={colors[1]} />
          <Line type="monotone" dataKey="uv" stroke={colors[3]} />
        </ComposedChart>
      </ChartWrapper>
    );
  }
}
